!function(){var s=angular.module("controllers",[]);s.controller("WorksController",function(s,o,t){o({method:"GET",url:"./asset/works.json"}).success(function(o){$.map(o.works,function(s){return s.description=t.trustAsHtml(s.description),s}),s.works=o.works})}),s.controller("QualitiesController",function(s,o){o({method:"GET",url:"./asset/qualities.json"}).success(function(o){s.results=o.qualities})}),s.controller("SkillsController",function(s,o){o({method:"GET",url:"./asset/skills.json"}).success(function(o){s.summaries=o.summaries,s.tools=o.tools})})}();